  // Example: Adding a city to a state
  const addCity = (state, cityInfo) => {
    setCityMap((prevMap) => {
      const newMap = new Map(prevMap);
      if (!newMap.has(state)) {
        newMap.set(state, []); // Initialize an empty array for the state
      }
      newMap.get(state).push(cityInfo); // Add the city information to the array
      return newMap;
    });
  };
  
  // Sample data structure for city information
  // Assume 'element' here would be available from your store data
  // Example: const element = { city: 'Delhi', startDate: '2021-01-01', location: 'Lat: XX, Long: YY' };

  const addCityInfo = (stateName, cityInfo) => {
    setCityMap((prevMap) => {
      const updatedMap = new Map(prevMap);
      if (!updatedMap.has(stateName)) {
        updatedMap.set(stateName, []);
      }
      updatedMap.get(stateName).push(cityInfo);
      return updatedMap;
    });
  };

  // Function to handle the state click and show the popup
  const handleStateClick = (stateName) => {

    if (cityMap.has(stateName)) {
      console.log(stateName)
      setSelectedState(stateName);
      setIsPopupVisible(true);
    }
  };

  // Example: Removing a city from a state
  const removeCity = (state, cityName) => {
    setCityMap((prevMap) => {
      const newMap = new Map(prevMap);
      if (newMap.has(state)) {
        const updatedCities = newMap
          .get(state)
          .filter((cityInfo) => cityInfo.name !== cityName); // Remove city by name
        if (updatedCities.length > 0) {
          newMap.set(state, updatedCities);
        } else {
          newMap.delete(state); // Remove state if no cities remain
        }
      }
      return newMap;
    });
  };
  const formatDate = (date) => {
    const timeAgo = new Date(date);
    const now = new Date();
    const diffInSeconds = Math.floor((now - timeAgo) / 1000);
    const diffInMinutes = Math.floor(diffInSeconds / 60);
    const diffInHours = Math.floor(diffInMinutes / 60);
    const diffInDays = Math.floor(diffInHours / 24);
    const diffInMonths = Math.floor(diffInDays / 30);
    const diffInYears = Math.floor(diffInMonths / 12);

    if (diffInYears > 0) return `${diffInYears} year${diffInYears > 1 ? 's' : ''} ago`;
    if (diffInMonths > 0) return `${diffInMonths} month${diffInMonths > 1 ? 's' : ''} ago`;
    if (diffInDays > 0) return `${diffInDays} day${diffInDays > 1 ? 's' : ''} ago`;
    if (diffInHours > 0) return `${diffInHours} hour${diffInHours > 1 ? 's' : ''} ago`;
    if (diffInMinutes > 0) return `${diffInMinutes} minute${diffInMinutes > 1 ? 's' : ''} ago`;
    return 'Just now';
  };
  const indiaBounds = { minLat: 6, maxLat: 37, minLong: 68, maxLong: 97 };

  // Map latitude and longitude to SVG coordinates
  const mapCoordinatesToSVG = (latitude, longitude) => {
    const { width, height } = containerSize;
    const x = ((longitude - indiaBounds.minLong) / (indiaBounds.maxLong - indiaBounds.minLong)) * width;
    const y = height - ((latitude - indiaBounds.minLat) / (indiaBounds.maxLat - indiaBounds.minLat)) * height;
    return { x, y };
  };

  // Fetch store data from the API
  const fetchStores = async () => {
    try {
      const response = await fetch(`${host}/darkkitchen/get-list`);
      if (!response.ok) throw new Error("Failed to fetch stores");
      const data = await response.json();
      data.forEach(element => {
        let cityInfo = {'name':element.city,'opendate':element.startDate,'location':element.location}
        console.log(cityInfo)
        addCity(element.state,cityInfo)
      });
      // console.log(data)
      setStores(data);

    } catch (error) {
      console.error("Error fetching stores:", error.message);
    }
  };

